Ingredients:
- 3/4 cup all purpose flour
- 1/4 cup whole wheat flour
- 1/2 cup cocoa powder
- 1 tsp baking soda
- 3/4 cup brown sugar
- 1/2 tsp salt
- 3 large bananas mashed
- 1/4 cup unsalted butter
- 1/4 cup vegetable oil
- 1 large egg
- 1 tsp vanilla extract
- 1 cup choco chips (or just cut any chocolate you have into small bits)
- 1/2 cup walnut crumbs (optional)
.
.
Procedure:
- Pre-heat the oven at 350F. Grease the pan with butter.
- Mix all the dry ingredients in one bowl, which includes all purpose flour, whole wheat flour, cocoa powder, baking soda and salt.
- Mix the melted butter, whisked egg into the mashed bananas. Add vegetable oil, brown sugar, vanilla extract and give it a stir.
- Add the dry mix into the wet mixture bowl slowly and keep stirring gently.
- Add half of the chocolate chips, walnut crumbs and give it a stir.
- Pour the mixture into greased pan. Sprinkle the remaining choco chips and walnut crumbs on the top.
- Bake for 50 min to 1 hour. (I baked mine for about 55 min.)
